import React, { Component } from 'react';
import { getMovies } from '../services/fakeMovieService';

class Movies extends Component {
  state = {
    movies: getMovies(),
  };

  render() {
    return (
      <div>
        <table>
          <div>
            <tr>
              <td>
                <strong>Title</strong>
              </td>
              <td>
                <strong>Genre</strong>
              </td>
              <td>
                <strong>Stock</strong>
              </td>
              <td>
                <strong>Rate</strong>
              </td>
              <td></td>
            </tr>
          </div>
          <tr>
            <td>{this.state.movies[0].title}</td>
            <td>{this.state.movies[0].genre.name}</td>
            <td>{this.state.movies[0].stock}</td>
            <td></td>
            <td></td>
          </tr>
        </table>
      </div>
    );
  }
}

export default Movies;
